        <h3>Player Performance</h3>
        <p>Performance visualization for player ID: {accountId}</p>
        <p>Match ID: {matchId}</p>
        <p>This is a placeholder for the player performance visualization.</p>
      </div>
    </div>
  );
};

export default PlayerPerformance;
